import React from "react"
const csstyle = {}
var time = new Date().getHours()
var greet = ''
if(time > 7 && time < 11){
    greet = "Good Morning"; 
    csstyle.color = "green";
}else if (time > 11 && time < 19) {
    greet = "Good Afternoon";
    csstyle.color = "orange";
} else {
    greet = "Good night";
    csstyle.color = "black";
    };

function Heading (){
    return  <h1>Hello , <span style={csstyle}>{greet}</span></h1>
}

export default Heading;

export {time};
